    "2016-07-27T22:20:42.463985",nt"name": "relationship-of-herd-density-and-physical-parameters-of-white-tailed-deer-in-northwest-flo",nt"isopen":
    false,nt"url": null,nt"notes": "A study assessing the effects of changes
    in deer density on physical  parameters of deer in northwest Florida flatwoods.
    Biological data from white-tailed deer harvested from a pine flatwood study site
    in northwest Florida from 1980-89 were used to evaluate the relationship between
    herd density and physical parameters. Deer density was reduced significantly (P
     0.05) between population density and these parameters. Although density was reduced
    by over 3-times, improvements in deer physical parameters were not observed. It
    appeared-red that herd reduction did little to improve nutritional plane. Apparently,
    the physical parameters of deer were insensitive to changes in density and their
    use in population management on poor quality habitats may be limited.",nt"license_title":
